import React from 'react';
import { useState } from 'react';
import './style.css';
import { FaSearch, FaCircle, FaCamera, FaImage, FaCogs, FaQuestion, FaPaperPlane } from 'react-icons/fa';
import { useHistory } from 'react-router-dom';

function Home() {
    const [search, setSearch] = useState('');
    const history = useHistory();

    const handleLogout = () => {
        // Xử lý đăng xuất ở đây, ví dụ xóa token khỏi localStorage hoặc state
        // Sau đó, chuyển hướng người dùng đến trang đăng nhập
        localStorage.removeItem('access_token');
        history.push('/login');
    };

    return (
        <div className="container">
            <div className="row clearfix">
                <div className="col-lg-12">
                    <div className="card chat-app">
                        <div id="plist" className="people-list">
                            <div className="input-group">
                                <div className="input-group-prepend">
                                    <span className="input-group-text"><FaSearch /></span>
                                </div>
                                <input 
                                    type="text" 
                                    className="form-control" 
                                    placeholder="Search..."
                                    value={search}
                                    onChange={(e) => setSearch(e.target.value)}
                                />
                            </div>
                            <ul className="list-unstyled chat-list mt-2 mb-0">
                                {/* List items go here */}
                            </ul>
                        </div>
                        <div className="chat">
                            <div className="chat-header clearfix">
                                <div className="row">
                                    <div className="col-lg-6">
                                        <a href="javascript:void(0);" data-toggle="modal" data-target="#view_info">
                                            <img src="https://bootdey.com/img/Content/avatar/avatar2.png" alt="avatar" />
                                        </a>
                                        <div className="chat-about">
                                            <h6 className="m-b-0">Aiden Chavez</h6>
                                            <small>Last seen: 2 hours ago</small>
                                        </div>
                                    </div>
                                    <div className="col-lg-6 hidden-sm text-right">
                                        <button className="btn btn-outline-danger" onClick={handleLogout}>Logout</button>
                                        <a href="javascript:void(0);" className="btn btn-outline-secondary"><FaCamera /></a>
                                        <a href="javascript:void(0);" className="btn btn-outline-primary"><FaImage /></a>
                                        <a href="javascript:void(0);" className="btn btn-outline-info"><FaCogs /></a>
                                        <a href="javascript:void(0);" className="btn btn-outline-warning"><FaQuestion /></a>
                                    </div>
                                </div>
                            </div>
                            <div className="chat-history">
                                <ul className="m-b-0">
                                    {/* Chat history items go here */}
                                </ul>
                            </div>
                            <div className="chat-message clearfix">
                                <div className="input-group mb-0">
                                    <div className="input-group-prepend">
                                        <span className="input-group-text">< FaPaperPlane /></span>
                                    </div>
                                    <input type="text" className="form-control" placeholder="Enter text here..." />                                    
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
